uction, 19, 101-111. doi:10.1016/j.ijdrr.2016.08.010.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Selby, D., &amp;amp;amp; Kagawa, F. (2012). Disaster risk reduction in school curricula: Case studies from thirty countries. Geneva: UNESCO and UNICEF.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Suhardjo, D. (2011). Arti penting pendidikan mitigasi bencana dalam mengurangi resiko bencana. Cakrawala Pendidikan, 0(2), 175-188. doi:10.21831/cp.v0i2.4226.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Sujarwo, S., Mulyadi, M., &amp;amp;amp; Tohani, E. (2015). Model pendidikan sadar lingkungan masyarakat korban erupsi merapi berbasis potensi lokal. Cakrawala Pendidikan, 34(01), 12-23. doi:10.21831/cp.v1i1.4172.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Sumarno, S., &amp;amp;amp; Suryono, Y. (2014). Community based education approach in disaster preparedness and mitigation. Strengthening community resiliency to disaster through disaster education development. Yogyakarta: Universitas Negeri Yogyakarta.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Takeuchi, Y., Mulyasari, F., &amp;amp;amp; Shaw, R. (2011). Roles of family and community in disaster. In R. Shaw, K. Shiwaku, &amp;amp;amp; Y. Takeuchi (Eds.), Disaster education: Community, environment, and disaster management (Vol. 7, pp. 77-94). Bingley: Emerald Group Publishing Limited.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Tribunjogja.com. (2018, Juni). Tak melulu bersifat negatif, letusan gunung berapi juga memberikan dampak positif ini. [Not always negative, volcano eruption can have positive impact] From http://jogja. tribunnews.com/2018/06/01/tak-melulu-bersifat-negatif-letusan-gunung-berapi-juga-memberikan-dampak-positif-ini.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;UNESCO. (2008). Building community resilience to natural disasters through partnership: sharing experience and expertise in the region. New York, NY: United Nations Publication.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Westlund, H. (2006). Social capital in the knowledge economy: Theory and empirics. Berlin: Springer-Verlag.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Widodo, E., Widowati, A., &amp;amp;amp; Suyoso, S. (2014). Model revitalisasi sekolah terdampak erupsi merapi melalui pembuatan perangkat pembelajaran inovatif berbahan dasar limbah anorganik. Cakrawala Pendidikan, 33(2), 277-285. doi:10.21831/ cp.v2i2.2167.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Wood, L. J., Boruff, B. J., &amp;amp;amp; Smith, H. M. (2013). When disaster strikes&amp;amp;hellip; How community cope and adapt: A social capital perspective. In C. D. Johnson (Ed.), Social capital: Theory, measurement and outcomes (pp. 143-169). New York, NY: Nova Science Publishers, Inc.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Woolcock, M. J. V. (1998). Social capital and economic development: Toward a theoretical synthesis and policy framework. Theory and Society, 27(2), 151-208. doi:10.1023/A:1006884930135.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Yin, R. K. (2015). Case study research: Designs and methods. California, CA: Sage Publication.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n', '', '20191008112916.pdf', 1, 'andi', 1),
(3, 'RECONSTRUCTION OF TEACHER&amp;acirc;Â€Â™S IDENTITY: A SOCIO-ANTHROPOLOGICAL STUDY OF THE JAVANESE SOCIETY', '\r\nTeachers, according to the Javanese&amp;acirc;Â€Â™s views, are those having a respectable position because they become the reference and role model for the Javanese. A teacher is considerably responsible for all students&amp;acirc;Â€Â™ behaviors, both in and outside the classroom. In this digital era, this condition has shifted due to the occurrence of socio-anthropological changes in society. Although teachers&amp;acirc;Â€Â™ identity shifts, they are still crucial in transferring values during the learning process. This study aimed to comprehensively find out how the reconstruction of teacher&amp;acirc;Â€Â™s identity was carried out in socio-anthropologically changing situations among the Javanese, derived from 30 respondents. Qualitative research was then used in this study using the ethnographic method, and the subject of the research was Javanese. Data collection was performed through interviews using a purposive selection of respondents. Analysis techniques comprised of data collection, data selection, data presentation, and conclusion. As a result, it was found that, in the context of the Javanese, socio-anthropology in modern technology had affected the meaning of the teacher&amp;acirc;Â€Â™s identity. Although the Javanese considered teachers as an ordinary profession and had the same level with other professions, the Javanese still held that teacher was an honorable profession and it deserved to be appreciated since the presence of a teacher could improve students&amp;acirc;Â€Â™ knowledge.', '&amp;lt;p&amp;gt;RECONSTRUCTION OF TEACHER&amp;amp;rsquo;S IDENTITY: A SOCIO-ANTHROPOLOGICAL STUDY OF THE JAVANESE SOCIETY&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;img src=&amp;quot;https://journal.uny.ac.id/public/site/images/icons/icon-people.png&amp;quot; style=&amp;quot;height:16px&amp;quot; /&amp;gt;&amp;amp;nbsp;&amp;lt;em&amp;gt;Sadam Fajar Shodiq, Syamsudin Syamsudin&amp;lt;/em&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;img src=&amp;quot;https://journal.uny.ac.id/public/site/images/icons/icon-doi.png&amp;quot; style=&amp;quot;height:16px&amp;quot; /&amp;gt;&amp;amp;nbsp;&amp;lt;a href=&amp;quot;http://dx.doi.org/10.21831/cp.v38i3.26098&amp;quot; style=&amp;quot;text-decoration-line: none; color: steelblue;&amp;quot;&amp;gt;10.21831/cp.v38i3.26098&amp;lt;/a&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Abstract&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Teachers, according to the Javanese&amp;amp;rsquo;s views, are those having a respectable position because they become the reference and role model for the Javanese. A teacher is considerably responsible for all students&amp;amp;rsquo; behaviors, both in and outside the classroom. In this digital era, this condition has shifted due to the occurrence of socio-anthropological changes in society. Although teachers&amp;amp;rsquo; identity shifts, they are still crucial in transferring values during the learning process. This study aimed to comprehensively find out how the reconstruction of teacher&amp;amp;rsquo;s identity was carried out in socio-anthropologically changing situations among the Javanese, derived from 30 respondents. Qualitative research was then used in this study using the ethnographic method, and the subject of the research was Javanese. Data collection was performed through interviews using a purposive selection of respondents. Analysis techniques comprised of data collection, data selection, data presentation, and conclusion. As a result, it was found that, in the context of the Javanese, socio-anthropology in modern technology had affected the meaning of the teacher&amp;amp;rsquo;s identity. Although the Javanese considered teachers as an ordinary profession and had the same level with other professions, the Javanese still held that teacher was an honorable profession and it deserved to be appreciated since the presence of a teacher could improve students&amp;amp;rsquo; knowledge.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Keywords&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;reconstruction; teacher&amp;amp;rsquo;s identity; socio-anthropology; Javanese&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;References&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Akkerman, S. F., &amp;amp;amp; Meijer, P. C. (2011). A Dialogical Approach to Conceptualizing Teacher Identity. Teaching and Teacher Education: An International Journal of Research and Studies, 27(2), 308-319. doi:10.1016/j.tate.2010.08.013.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Araujo, L. De, Rodrigues, D., Pietri, E. De, &amp;amp;amp; Santiago, H. (2018). The role of experienced teachers in the development of pre-service language teachers&amp;amp;rsquo; professional identity: Revisiting school memories and constructing future teacher selves. International Journal of Educational Research, 88(1), 146&amp;amp;ndash;155. doi:10.1016/j.ijer.2018.02.002.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Arvaja, M. (2016). Building teacher identity through the process of positioning. Teaching and Teacher Education, 59(3), 392&amp;amp;ndash;402. doi:10.1016/j.tate.2016.07.024.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Avidov-ungar, O., &amp;amp;amp; Forkosh-baruch, A. (2018). Professional identity of teacher educators in the digital era in light of demands of pedagogical innovation. Teaching and Teacher Education, 73(2), 183&amp;amp;ndash;191. doi:10.1016/j.tate.2018.03.017.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Boylan, M., &amp;amp;amp; Woolsey, I. (2015). Teacher education for social justice: Mapping identi