(29, '2018-11-18 09:29:58', 1, 'insert into awp_produk set produk=''GPS Tracker NEW VT-90Z'', category_id=''2'', diskripsi=''GPS Tracker NEW VT-90Z\\r\\nMerek: Super Spring\\r\\nKode Produk: VT-90Z'', content=''&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;FRUSTASI dengan GPS Tracker merek abal-abal&amp;lt;/strong&amp;gt;? Percayakan&amp;lt;strong&amp;gt;&amp;amp;nbsp;pelacakan dan keamanan kendaraan&amp;lt;/strong&amp;gt;&amp;amp;nbsp;Anda dengan&amp;amp;nbsp;&amp;lt;strong&amp;gt;SUPER SPRING GPS Tracker&amp;lt;/strong&amp;gt;.&amp;amp;nbsp;&amp;lt;strong&amp;gt;Ingatlah&amp;amp;nbsp;&amp;lt;/strong&amp;gt;bahwa&amp;amp;nbsp;&amp;lt;strong&amp;gt;membeli GPS Tracker&amp;lt;/strong&amp;gt;&amp;amp;nbsp;sama dengan&amp;amp;nbsp;&amp;lt;strong&amp;gt;membeli 50% produk dan 50% jasa&amp;lt;/strong&amp;gt;. Produk ini tentunya tidak akan sempurna apabila tidak didukung layanan purna jual yang baik.&amp;amp;nbsp;&amp;lt;strong&amp;gt;SUPER SPRING&amp;lt;/strong&amp;gt;&amp;amp;nbsp;hadir dengan layanan purna jual yang bisa diandalkan, mulai dari: kantor dan&amp;amp;nbsp;&amp;lt;strong&amp;gt;call Center 24 jam&amp;lt;/strong&amp;gt;, didukung lebih dari 40 kantor cabang se-Indonesia,&amp;amp;nbsp;&amp;lt;strong&amp;gt;GRATIS konsultasi&amp;lt;/strong&amp;gt;&amp;amp;nbsp;dan training produk,&amp;amp;nbsp;&amp;lt;strong&amp;gt;GRATIS penggunaan web moitoring selamanya&amp;lt;/strong&amp;gt;, berpengalaman lebih dari 6 tahun di bidang GPS dan tentunya dengan&amp;amp;nbsp;&amp;lt;strong&amp;gt;harga yang sangat ekonomi&amp;lt;/strong&amp;gt;s. Pastikan GPS Tracker Anda bermerek&amp;amp;nbsp;&amp;lt;strong&amp;gt;SUPER SPRING&amp;amp;nbsp;&amp;lt;/strong&amp;gt;!&amp;lt;/p&amp;gt;\\r\\n'', harga=''1899000'', keyword=''gps mobil, GPS Tracker NEW VT-90Z'', active=''1'', gambar_1=''20181118092738.jpg'', gambar_2=''20181118092746.jpg'', gambar_3=''20181118092750.jpg'', gambar_4=''20181118092755.jpg''', '', 'Tambah Produk', '::1'),
(30, '2018-11-18 09:34:07', 1, 'insert into awp_produk set produk=''GPS GT06N'', category_id=''2'', diskripsi=''Gps Tracker Mobil / Motor Pelacak Matikan Mesin Tracking Android IOS'', content=''&amp;lt;p&amp;gt;BONUS Pendaftaran di WEB SERVER ORANGE lifetime&amp;amp;nbsp;&amp;lt;br /&amp;gt;\\r\\nSatu Akun login bisa 5 Unit GPS Tracker.&amp;amp;nbsp;&amp;lt;br /&amp;gt;\\r\\nContoh seperti di gambar&amp;lt;br /&amp;gt;\\r\\nGPS GT06N dilengkapi dengan fitur utama&amp;amp;nbsp;&amp;lt;br /&amp;gt;\\r\\n1. lacak melalui sms google map, aplikasi android iphone ios dan web&amp;amp;nbsp;&amp;lt;br /&amp;gt;\\r\\n2. mendengarkan suara didalam kendaraan&amp;amp;nbsp;&amp;lt;br /&amp;gt;\\r\\n3. matikan mesin lewat HP&amp;amp;nbsp;&amp;lt;br /&amp;gt;\\r\\n&amp;lt;br /&amp;gt;\\r\\nFitur-fitur GT06N&amp;amp;nbsp;&amp;lt;br /&amp;gt;\\r\\n* Pelacakan realtime (via sms dan web)&amp;amp;nbsp;&amp;lt;br /&amp;gt;\\r\\n* Mematikan mesin (via sms)&amp;amp;nbsp;&amp;lt;br /&amp;gt;\\r\\n* Menyadap suara&amp;amp;nbsp;&amp;lt;br /&amp;gt;\\r\\n* Notifikasi apabila aki berusaha di cabut&amp;amp;nbsp;&amp;lt;br /&amp;gt;\\r\\n* Cek Pulsa tanpa melepas Sim Card dari GPS Tracker&amp;amp;nbsp;&amp;lt;br /&amp;gt;\\r\\n* Laporan perjalanan rinci s/d 30 hari&amp;amp;nbsp;&amp;lt;br /&amp;gt;\\r\\n* Aktivasi Paket GPRS tanpa melepas Sim Card dari GPS Tracker&amp;amp;nbsp;&amp;lt;br /&amp;gt;\\r\\n* Mode power saving (mode hemat baterai)&amp;amp;nbsp;&amp;lt;br /&amp;gt;\\r\\n* Terdapat baterai cadangan bila aki dicabut&amp;amp;nbsp;&amp;lt;br /&amp;gt;\\r\\n* Pemberitahuan jika baterai lemah&amp;lt;br /&amp;gt;\\r\\n* Sensitifitas GPS Chipset dan getaran tinggi&amp;lt;br /&amp;gt;\\r\\n* Tiga LED indikator: GPS-biru; GSM-hijau; Power-merah&amp;amp;nbsp;&amp;lt;br /&amp;gt;\\r\\n* Tombol SOS untuk SOS Alarm&amp;amp;nbsp;&amp;lt;br /&amp;gt;\\r\\n&amp;lt;br /&amp;gt;\\r\\nKelengkapan :&amp;amp;nbsp;&amp;lt;br /&amp;gt;\\r\\n- 1 unit GPS Tracker GT06N&amp;amp;nbsp;&amp;lt;br /&amp;gt;\\r\\n- 1 unit Relay 12V&amp;amp;nbsp;&amp;lt;br /&amp;gt;\\r\\n- 1 unit Microphone&amp;amp;nbsp;&amp;lt;br /&amp;gt;\\r\\n- 1 unit Tombol SOS&amp;amp;nbsp;&amp;lt;br /&amp;gt;\\r\\n- Kabel&amp;amp;nbsp;&amp;lt;br /&amp;gt;\\r\\n- Manual book&amp;lt;/p&amp;gt;\\r\\n\\r\\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\\r\\n\\r\\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\\r\\n'', harga=''355000'', keyword=''GPS GT06N, GPS Mobil'', active=''1'', gambar_1=''20181118093222.jpg'', gambar_2=''20181118093247.jpg'', gambar_3=''20181118093237.jpg'', gambar_4=''20181118093242.jpg''', '', 'Tambah Produk', '::1'),
