(33, '2018-11-19 11:35:21', 1, 'update awp_pages_content set content_title=''TENTANG KAMI'', content_tagline='''', content_text=''&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;AVA Brid Farm,&amp;lt;/strong&amp;gt; Kami rintis sejak tahun 2011 kami memulainya berdasarkan rasa cinta terhadap burung, burung murai dan kenari,&amp;amp;nbsp; Meskipun sempat mengalami kefakuman ditahun 2015 sd 2017 kini kami hadir kembali untuk mencetak produk yang berkualitas untuk para pencinta burung Kenari dan Murai. Dengan berbekal sayang dan cinta terhadap burung kami bisa menjadikan peternak murai dan kenari yang berkualitas&amp;amp;nbsp;&amp;lt;/p&amp;gt;\\r\\n'', content_description=''AVA Brid Farm, Kami rintis sejak tahun 2011 kami memulainya berdasarkan rasa cinta terhadap burung, burung murai dan kenari,  Meskipun sempat mengalami kefakuman ditahun 2015 sd 2017 kini kami hadir kembali untuk mencetak produk yang berkualitas untuk par'', content_tag=''AVA Brid Farm, burung , murai, kenari'', publish=''1'', updated_date=''2018-11-19 11:29:54'', content_image=''20181119113511.png'' where content_id=''1''', '', 'Edit Page', '::1'),
(34, '2018-11-19 11:44:54', 1, 'update awp_pages_content set content_title=''TENTANG KAMI'', content_tagline='''', content_text=''&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Planet GPS Jogja.&amp;amp;nbsp;&amp;lt;/strong&amp;gt;Global Postioning Sistem merupaka perangkat pelacak kendaraan yang dapat menampilkan lokasi kendaraan dengan akurat dari segi tempat dan waktu (Real Time)&amp;amp;nbsp;&amp;lt;/p&amp;gt;\\r\\n'', content_description=''Global Postioning Sistem merupaka perangkat pelacak kendaraan yang dapat menampilkan lokasi kendaraan dengan akurat dari segi tempat dan waktu (Real Time) '', content_tag=''pasang GPS JOgja'', publish=''1'', updated_date=''2018-11-19 11:35:20'', content_image=''20181119113511.png'' where content_id=''1''', '', 'Edit Page', '::1'),
(35, '2018-11-20 02:53:34', 1, 'insert into awp_produk set produk=''GPS Motor Tracker Nubi GPS NB1000C'', category_id=''1'', diskripsi=''GPS Tracking untuk motor sangat praktis, dengan alat ini motor anda bisa dipantau kapanpun dari PC, android datau IOS.  Dengan Nubi GPS anda bisa melihat secara real time posisi kendaraan anda, bukan hanya posisi anda juga bisa melihat kecepatan dan history kemana saja kendaraan anda dalam beberapa waktu terakhir.'', content=''&amp;lt;p&amp;gt;Fiture GPS Motorcyscle Tracker Nubi GPS NB1000C :&amp;lt;/p&amp;gt;\\r\\n\\r\\n&amp;lt;ol&amp;gt;\\r\\n	&amp;lt;li&amp;gt;GPS + AGPS Tracking dengan menunjukkan lokasi secara realtime dan berkala&amp;lt;/li&amp;gt;\\r\\n	&amp;lt;li&amp;gt;Perlindungan baterai kendaraan, tidak akan kehabisan batere selama aki motor anda tidak habis.&amp;lt;/li&amp;gt;\\r\\n	&amp;lt;li&amp;gt;Deteksi status kendaraan apakah dalam posisi mati atau hidup.&amp;lt;/li&amp;gt;\\r\\n	&amp;lt;li&amp;gt;IP 65 tahan terhadap air dan debu&amp;lt;/li&amp;gt;\\r\\n	&amp;lt;li&amp;gt;Bisa mematikan mesin dari jarak jauh&amp;lt;/li&amp;gt;\\r\\n	&amp;lt;li&amp;gt;Melack menggunakan web, sms atau aplikasi&amp;lt;/li&amp;gt;\\r\\n	&amp;lt;li&amp;gt;Pengaturan daya,mengurani konsumsi power yg tidak efesien ketika perangkat dalam posisi standby&amp;lt;/li&amp;gt;\\r\\n	&amp;lt;li&amp;gt;Multi alarm : memberikan peringatan ketika kendaraan bergetar, over speed, power mati, atau geofence.&amp;lt;/li&amp;gt;\\r\\n&amp;lt;/ol&amp;gt;\\r\\n\\r\\n&amp;lt;p&amp;gt;Spesifikasi :&amp;lt;/p&amp;gt;\\r\\n\\r\\n&amp;lt;ul&amp;gt;\\r\\n	&amp;lt;li&amp;gt;Frekueni : GSM 850/900/1800/1900 hz&amp;lt;/li&amp;gt;\\r\\n	&amp;lt;li&amp;gt;GPRS kelas I2, TCP/IP&amp;lt;/li&amp;gt;\\r\\n	&amp;lt;li&amp;gt;Memory 32 + 32 MB&amp;lt;/li&amp;gt;\\r\\n	&amp;lt;li&amp;gt;Kesalahan fase : RMSPE &amp;amp;lt;5&amp;lt;/li&amp;gt;\\r\\n	&amp;lt;li&amp;gt;Max Output : GSM 1800&amp;lt;/li&amp;gt;\\r\\n	&amp;lt;li&amp;gt;Chipset GPS : MTK&amp;lt;/li&amp;gt;\\r\\n	&amp;lt;li&amp;gt;Frequensi Code : L1&amp;lt;/li&amp;gt;\\r\\n	&amp;lt;li&amp;gt;Chanel : 66&amp;lt;/li&amp;gt;\\r\\n	&amp;lt;li&amp;gt;Akurasi :&amp;amp;lt;10 m&amp;lt;/li&amp;gt;\\r\\n	&amp;lt;li&amp;gt;Standy time : 60 jam&amp;lt;/li&amp;gt;\\r\\n	&amp;lt;li&amp;gt;Aktife : 3 jam&amp;lt;/li&amp;gt;\\r\\n	&amp;lt;li&amp;gt;Berat : 48.5 gram&amp;lt;/li&amp;gt;\\r\\n&amp;lt;/ul&amp;gt;\\r\\n'', harga=''300000'', keyword=''gps motor'', active=''1'', gambar_1=''20181120025114.jpg'', gambar_2=''20181120025125.jpg'', gambar_3=''20181120025128.jpg'', gambar_4=''20181120025138.jpg''', '', 'Tambah Produk', '::1'),
(36, '2018-11-20 02:57:36', 1, 'insert into awp_produk set produk=''GPS anti-diefstal motorfiets Tracker 01'', category_id=''1'', diskripsi=''Beveilig eenvoudig zelf uw motor of scooter met deze kleine handzame GPS Tracker. Op elke motor is er wel een plekje beschikbaar om dit kastje van slechts 9 x 3,2 x 2 cm te plaatsen'', content=''&amp;lt;p&amp;gt;Beveilig eenvoudig zelf uw motor of scooter met deze kleine handzame GPS Tracker. Op elke motor is er wel een plekje beschikbaar om dit kastje van slechts 9 x 3,2 x 2 cm te plaatsen. U kunt zelf eenvoudig vanaf de PC of smartphone zien waar de motor zich bevindt. Ook is het mogelijk om een melding te krijgen wanneer de motor buiten een vooraf bepaald gebied verplaatst wordt. De tracker werkt in heel Europa. Toepasbaar op motoren, scooters, boten, maar ook dure werktuigen als aggegaten, motormaaiers, aanhangwagens etc.&amp;lt;/p&amp;gt;\\r\\n'', harga=''3500000'', keyword=''gps motor'', active=''1'', gambar_1=''20181120025644.jpg'', gambar_2=''20181120025651.jpg'', gambar_3=''20181120025656.jpg'', gambar_4=''20181120025704.jpg''', '', 'Tambah Produk', '::1'),
