(107, '2019-09-27 11:54:04', 1, 'insert into awp_surat set judul=''PENGANTAR SKRIPSI TS'', surat=''&amp;lt;p style=&amp;quot;margin-left:92.15pt&amp;quot;&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\\r\\n\\r\\n&amp;lt;p&amp;gt;Nomor&amp;amp;nbsp; :&amp;amp;nbsp; 000/XXX/XX/XX/XX/XX/XXXX/0000&amp;lt;/p&amp;gt;\\r\\n\\r\\n&amp;lt;p&amp;gt;Hal&amp;amp;nbsp;&amp;amp;nbsp;&amp;amp;nbsp;&amp;amp;nbsp;&amp;amp;nbsp;&amp;amp;nbsp; :&amp;amp;nbsp; &amp;lt;strong&amp;gt;Permohonan izin Penelitian Tugas Akhir (TA)&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\\r\\n\\r\\n&amp;lt;p style=&amp;quot;margin-left:63.0pt&amp;quot;&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\\r\\n\\r\\n&amp;lt;p style=&amp;quot;margin-left:63.0pt&amp;quot;&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\\r\\n\\r\\n&amp;lt;p&amp;gt;Kepada Yth :&amp;lt;/p&amp;gt;\\r\\n\\r\\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;XX. XXXXX XXXXX XXXX&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;\\r\\n\\r\\n&amp;lt;p&amp;gt;Xxxxxxx Xx. 00 Xxxxxx Xxxxx&amp;lt;/p&amp;gt;\\r\\n\\r\\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\\r\\n\\r\\n&amp;lt;p&amp;gt;Salam dan bahagia,&amp;lt;/p&amp;gt;\\r\\n\\r\\n&amp;lt;p&amp;gt;Sebagai persyaratan dalam menyelesaikan Program S-1 Program Studi Teknik Industri Fakultas Teknik Universitas Sarjanawiyata Tamansiswa, para mahasiswa diwajibkan menempuh Mata Kuliah Tugas Akhir (Skripsi). Guna memenuhi persyaratan tersebut melalui surat ini kami memohonkan izin mahasiswa kami agar diperkenankan untuk melakukan Penelitian di &amp;lt;strong&amp;gt;XX. XXXXX XXXXX XXXX&amp;lt;/strong&amp;gt;, Xxxxxxx Xx. 00 Xxxxxx Xxxxx.&amp;lt;/p&amp;gt;\\r\\n\\r\\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\\r\\n\\r\\n&amp;lt;p&amp;gt;Adapun mahasiswa yang akan melakukan Penelitian adalah :&amp;lt;/p&amp;gt;\\r\\n\\r\\n&amp;lt;p style=&amp;quot;margin-left:49.65pt&amp;quot;&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\\r\\n\\r\\n&amp;lt;table border=&amp;quot;1&amp;quot; cellpadding=&amp;quot;0&amp;quot; cellspacing=&amp;quot;0&am