(121, '2019-10-08 11:07:24', 1, 'insert into awp_posts set post_title=''Apakah Lorem Ipsum itu?'', post_content=''&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Lorem Ipsum&amp;lt;/strong&amp;gt;&amp;amp;nbsp;adalah contoh teks atau dummy dalam industri percetakan dan penataan huruf atau typesetting. Lorem Ipsum telah menjadi standar contoh teks sejak tahun 1500an, saat seorang tukang cetak yang tidak dikenal mengambil sebuah kumpulan teks dan mengacaknya untuk menjadi sebuah buku contoh huruf. Ia tidak hanya bertahan selama 5 abad, tapi juga telah beralih ke penataan huruf elektronik, tanpa ada perubahan apapun. Ia mulai dipopulerkan pada tahun 1960 dengan diluncurkannya lembaran-lembaran Letraset yang menggunakan kalimat-kalimat dari Lorem Ipsum, dan seiring munculnya perangkat lunak Desktop Publishing seperti Aldus PageMaker juga memiliki versi Lorem Ipsum.&amp;lt;/p&amp;gt;\\r\\n'', post_description=''Lorem Ipsum adalah contoh teks atau dummy dalam industri percetakan dan penataan huruf atau typesetting. Lorem Ipsum telah menjadi standar contoh teks sejak tahun 1500an, saat seorang tukang'', post_tag='''', posts_author=''andi'', publish=''1'', post_category=''4'', post_type=''post'', created_date=''2019-10-08 11:06:24'', post_image=''20191008110720.jpg''', '', 'add new Berita', '::1'),
(122, '2019-10-08 11:08:01', 1, 'insert into awp_posts set post_title=''Mengapa kita menggunakannya?'', post_content=''&amp;lt;p&amp;gt;Sudah merupakan fakta bahwa seorang pembaca akan terpengaruh oleh isi tulisan dari sebuah halaman saat ia melihat tata letaknya. Maksud penggunaan Lorem Ipsum adalah karena ia kurang lebih memiliki penyebaran huruf yang normal, ketimbang menggunakan kalimat seperti &amp;amp;quot;Bagian isi disini, bagian isi disini&amp;amp;quot;, sehingga ia seolah menjadi naskah Inggris yang bisa dibaca. Banyak paket Desktop Publishing dan editor situs web yang kini menggunakan Lorem Ipsum sebagai contoh teks. Karenanya pencarian terhadap kalimat &amp;amp;quot;Lorem Ipsum&amp;amp;quot; akan berujung pada banyak situs web yang masih dalam tahap pengembangan. Berbagai versi juga telah berubah dari tahun ke tahun, kadang karena tidak sengaja, kadang karena disengaja (misalnya karena dimasukkan unsur humor atau semacamnya)&amp;lt;/p&amp;gt;\\r\\n'', post_description=''Sudah merupakan fakta bahwa seorang pembaca akan terpengaruh oleh isi tulisan dari sebuah halaman saat ia melihat tata letaknya. Maksud penggunaan Lorem Ipsum adalah karena ia kurang lebih memiliki penyebaran huruf yang normal, ketimbang menggunakan kalimat seperti'', post_tag='''', posts_author=''andi'', publish=''1'', post_category=''4'', post_type=''post'', created_date=''2019-10-08 11:07:51'', post_image=''20191008110759.jpg''', '', 'add new Berita', '::1'),
(123, '2019-10-08 11:08:58', 1, 'insert into awp_posts set post_title=''Dari mana asalnya?'', post_content=''&amp;lt;p&amp;gt;Tidak seperti anggapan banyak orang, Lorem Ipsum bukanlah teks-teks yang diacak. Ia berakar dari sebuah naskah sastra latin klasik dari era 45 sebelum masehi, hingga bisa dipastikan usianya telah mencapai lebih dari 2000 tahun. Richard McClintock, seorang professor Bahasa Latin dari Hampden-Sidney College di Virginia, mencoba mencari makna salah satu kata latin yang dianggap paling tidak jelas, yakni consectetur, yang diambil dari salah satu bagian Lorem Ipsum. Setelah ia mencari maknanya di di literatur klasik, ia mendapatkan sebuah sumber yang tidak bisa diragukan. Lorem Ipsum berasal dari bagian 1.10.32 dan 1.10.33 dari naskah &amp;amp;quot;de Finibus Bonorum et Malorum&amp;amp;quot; (Sisi Ekstrim dari Kebaikan dan Kejahatan) karya Cicero, yang ditulis pada tahun 45 sebelum masehi. BUku ini adalah risalah dari teori etika yang sangat terkenal pada masa Renaissance. Baris pertama dari Lorem Ipsum, &amp;amp;quot;Lorem ipsum dolor sit amet..&amp;amp;quot;, berasal dari sebuah baris di bagian 1.10.32.&amp;lt;/p&amp;gt;\\r\\n'', post_description=''Tidak seperti anggapan banyak orang, Lorem Ipsum bukanlah teks-teks yang diacak. Ia berakar dari sebuah naskah sastra latin klasik dari era 45 sebelum masehi, hingga bisa dipastikan usianya telah mencapai lebih dari 2000 tahun.'', post_tag='''', posts_author=''andi'', publish=''1'', post_category=''4'', post_type=''post'', created_date=''2019-10-08 11:08:01'', post_image=''20191008110856.jpg''', '', 'add new Berita', '::1'),
(124, '2019-10-08 11:21:02', 1, 'insert into awp_posts set post_title=''Dari mana saya bisa mendapatkannya?'', post_content=''&amp;lt;p&amp;gt;Ada banyak variasi tulisan Lorem Ipsum yang tersedia, tapi kebanyakan sudah mengalami perubahan bentuk, entah karena unsur humor atau kalimat yang diacak hingga nampak sangat tidak masuk akal. Jika anda ingin menggunakan tulisan Lorem Ipsum, anda harus yakin tidak ada bagian yang memalukan yang tersembunyi di tengah naskah tersebut. Semua generator Lorem Ipsum di internet cenderung untuk mengulang bagian-bagian tertentu. Karena itu inilah generator pertama yang sebenarnya di internet. Ia menggunakan kamus perbendaharaan yang terdiri dari 200 kata Latin, yang digabung dengan banyak contoh struktur kalimat untuk menghasilkan Lorem Ipsun yang nampak masuk akal. Karena itu Lorem Ipsun yang dihasilkan akan selalu bebas dari pengulangan, unsur humor yang sengaja dimasukkan, kata yang tidak sesuai dengan karakteristiknya dan lain sebagainya&amp;lt;/p&amp;gt;\\r\\n'', post_description=''Ada banyak variasi tulisan Lorem Ipsum yang tersedia, tapi kebanyakan sudah mengalami perubahan bentuk, entah karena unsur humor atau kalimat yang diacak hingga nampak sangat tidak masuk akal. Jika anda ingin menggunakan tulisan Lorem Ipsum, anda harus yaki'', post_tag='''', posts_author=''andi'', publish=''1'', post_category=''3'', post_type=''post'', created_date=''2019-10-08 11:20:34'', post_image=''20191008112057.jpg''', '', 'add new Informasi', '::1'),
(125, '2019-10-08 11:21:50', 1, 'insert into awp_posts set post_title=''Naskah Lorem Ipsum standar yang digunakan sejak tahun 1500an'', post_content=''&amp;lt;p style=&amp;quot;text-align:justify&amp;quot;&amp;gt;&amp;amp;quot;Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.&amp;amp;quot;&amp;lt;/p&amp;gt;\\r\\n\\r\\n&amp;lt;p&amp;gt;Bagian 1.10.32 dari &amp;amp;quot;de Finibus Bonorum et Malorum&amp;amp;quot;, ditulis oleh Cicero pada tahun 45 sebelum masehi&amp;lt;/p&amp;gt;\\r\\n\\r\\n&amp;lt;p style=&amp;quot;text-align:justify&amp;quot;&amp;gt;&amp;amp;quot;Sed ut perspiciatis unde omnis iste natus error sit voluptatem accusantium doloremque laudantium, totam rem aperiam, eaque ipsa quae ab illo inventore veritatis et quasi architecto beatae vitae dicta sunt explicabo. Nemo enim ipsam voluptatem quia voluptas sit aspernatur aut odit aut fugit, sed quia consequuntur magni dolores eos qui ratione voluptatem sequi nesciunt. Neque porro quisquam est, qui dolorem ipsum quia dolor sit amet, consectetur, adipisci velit, sed quia non numquam eius modi tempora incidunt ut labore et dolore magnam aliquam quaerat voluptatem. Ut enim ad minima veniam, quis nostrum exercitationem ullam corporis suscipit laboriosam, nisi ut aliquid ex ea commodi consequatur? Quis autem vel eum iure reprehenderit qui in ea voluptate velit esse quam nihil molestiae consequatur, vel illum qui dolorem eum fugiat quo voluptas nulla pariatur?&amp;amp;quot;&amp;lt;/p&amp;gt;\\r\\n\\r\\n&amp;lt;p&amp;gt;Terjemahan tahun 1914 oleh H. Rackham&amp;lt;/p&amp;gt;\\r\\n\\r\\n&amp;lt;p style=&amp;quot;text-align:justify&amp;quot;&amp;gt;&amp;amp;quot;But I must explain to you how all this mistaken idea of denouncing pleasure and praising pain was born and I will give you a complete account of the system, and expound the actual teachings of the great explorer of the truth, the master-builder of human happiness. No one rejects, dislikes, or avoids pleasure itself, because it is pleasure, but because those who do not know how to pursue pleasure rationally encounter consequences that are extremely painful. Nor again is there anyone who loves or pursues or desires to obtain pain of itself, because it is pain, but because occasionally circumstances occur in which toil and pain can procure him some great pleasure. To take a trivial example, which of us ever undertakes laborious physical exercise, except to obtain some advantage from it? But who has any right to find fault with a man who chooses to enjoy a pleasure that has no annoying consequences, or one who avoids a pain that produces no resultant pleasure?&amp;amp;quot;&amp;lt;/p&amp;gt;\\r\\n'', post_description=''&amp;quot;Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit '', post_tag='''', posts_author=''andi'', publish=''1'', post_category=''3'', post_type=''post'', created_date=''2019-10-08 11:21:01'', post_image=''20191008112148.jpg''', '', 'add new Informasi', '::1'),
(126, '2019-10-08 11:22:21', 1, 'insert into awp_posts set post_title=''Terjemahan tahun 1914 oleh H. Rackham'', post_content=''&amp;lt;p&amp;gt;&amp;amp;quot;On the other hand, we denounce with righteous indignation and dislike men who are so beguiled and demoralized by the charms of pleasure of the moment, so blinded by desire, that they cannot foresee the pain and trouble that are bound to ensue; and equal blame belongs to those who fail in their duty through weakness of will, which is the same as saying through shrinking from toil and pain. These cases are perfectly simple and easy to distinguish. In a free hour, when our power of choice is untrammelled and when nothing prevents our being able to do what we like best, every pleasure is to be welcomed and every pain avoided. But in certain circumstances and owing to the claims of duty or the obligations of business it will frequently occur that pleasures have to be repudiated and annoyances accepted. The wise man therefore always holds in these matters to this principle of selection: he rejects pleasures to secure other greater pleasures, or else he endures pains to avoid worse pains.&amp;amp;quot;&amp;lt;/p&amp;gt;\\r\\n'', post_description=''&amp;quot;On the other hand, we denounce with righteous indignation and dislike men who are so beguiled and demoralized by the charms of pleasure of the moment, so blinded by desire'', post_tag='''', posts_author=''andi'', publish=''1'', post_category=''3'', post_type=''post'', created_date=''2019-10-08 11:21:50'', post_image=''20191008112220.jpg''', '', 'add new Informasi', '::1');
