(127, '2019-10-08 11:27:52', 1, 'update awp_jurnal set jurnal=''MULTICULTURAL COMPETENCE OF PROSPECTIVE PRESCHOOL TEACHERS IN PREDOMINANTLY MUSLIM COUNTRY'', diskripsi=''Prepared to teach young children in a multi-ethnic and religious society like in Indonesia, the prospective preschool teachers should have strong belief and practice in social justice and multiculturalism. However, this quality is not easily achievable by prospective teachers from ethnic and religious majority group, like Indonesian Muslim prospective '', abstrak=''&amp;lt;p style=&amp;quot;text-align:justify&amp;quot;&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\\r\\n\\r\\n&amp;lt;p&amp;gt;Abstract&amp;lt;/p&amp;gt;\\r\\n\\r\\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\\r\\n\\r\\n&amp;lt;p&amp;gt;Prepared to teach young children in a multi-ethnic and religious society like in Indonesia, the prospective preschool teachers should have strong belief and practice in social justice and multiculturalism. However, this quality is not easily achievable by prospective teachers from ethnic and religious majority group, like Indonesian Muslim prospective preschool teachers who may have limited awareness and exposure to multicultural diversity. This study identified some existing multicultural competences of the participants before designing a training model to prepare prospective preschool teachers, to develop their multicultural competence. Data for this study were derived from the questionnaire and interview which reveal awareness, knowledge, and skill dimensions of multicultural competence. Findings show that the majority of the participants have a high level of multicultural awareness and indicate a difference in multicultural competence among different levels of students. Based on these findings and expert judgments, the study designs a training model to develop prospective preschool teachers&amp;amp;rsquo; multicultural competence which has the following sequence: systematic reflection, Socratic dialog, simulation, field practice, and reflection. The study also provides some recommendations on the inclusion of multicultural content into intracurricular and/or extracurricular activities as well as on testing and analyzing the effectiveness of the hypothetical training model resulted from this study.&amp;lt;/p&amp;gt;\\r\\n\\r\\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\\r\\n\\r\\n&amp;lt;p&amp;gt;Keywords&amp;lt;/p&amp;gt;\\r\\n\\r\\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\\r\\n\\r\\n&amp;lt;p&amp;gt;preschool teachers; multicultural competence; predominantly muslim prospective&amp;lt;/p&amp;gt;\\r\\n\\r\\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\\r\\n\\r\\n&amp;lt;p&amp;gt;References&amp;lt;/p&amp;gt;\\r\\n\\r\\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\\r\\n\\r\\n&amp;lt;p&amp;gt;Alfulailah, N., Haryadi, Sudrajat, A., &amp;amp;amp; Nasrullah. (2019). The effectiveness of multicultural approach in writing achievement of Indonesian language. Cakrawala Pendidikan, 38(2), 1-15. doi:10.21831/cp.v38i2.23440.&amp;lt;/p&amp;gt;\\r\\n\\r\\n&amp;lt;p&amp;gt;Arsal, Z. (2019). Critical multicultural education and prospective teachers&amp;amp;rsquo; multicultural attitudes. Journal for Multicultural Education, 13(1), 106-118. doi:10.1108/JME-10-2017-0059.&amp;lt;/p&amp;gt;\\r\\n\\r\\n&amp;lt;p&amp;gt;Banks, J. A. (2006). Race, culture, and education: The selected works of James A. Banks. London, England: Routledge.&amp;lt;/p&amp;gt;\\r\\n\\r\\n&amp;lt;p&amp;gt;Baruth, L. G. &amp;amp;amp; Manning, M. L. (2012). Multicultural counseling and psychotherapy: A life span approach. Hoboken, NJ: Pearson Education.&amp;lt;/p&amp;gt;\\r\\n\\r\\n&amp;lt;p&amp;gt;Bennett, S. V. (2012). Effective facets of a field experience that contributed to eight prospective teachers&amp;amp;rsquo; developing understandings about culturally responsive teaching. Urban Education, 48(3), 380-419. doi:10.1177/0042085912452155.&amp;lt;/p&amp;gt;\\r\\n\\r\\n&amp;lt;p&amp;gt;Bidell, M. P. (2012). Examining school counseling students&amp;amp;#39; multicultural and sexual orientation competencies through a cross-specialization comparison. Journal of Counseling and Development, 90(2), 200-207. doi:10.1111/j.1556-6676.2012.00025.x.&amp;lt;/p&amp;gt;\\r\\n\\r\\n&amp;lt;p&amp;gt;Blodorn, A., O&amp;amp;rsquo;Brien, L. T., Cheryan, S., &amp;amp;amp; Vick, S. B. (2016). Understanding perceptions of racism in the aftermath of hurricane Katrina: The roles of system and group justification. Social Justice Journal, 29(2), 139-158. doi:10.1007/s11211-016-0259-9.&amp;lt;/p&amp;gt;\\r\\n\\r\\n&amp;lt;p&amp;gt;Bonner, P. J., Warren, S. R., &amp;amp;amp; Jiang, Y. H. (2018). Voices from urban classrooms: Teachers&amp;amp;rsquo; perceptions on instructing diverse students and using culturally responsive teaching. Education and Urban Society, 50(8), 697&amp;amp;ndash;726. doi:10.1177/0013124517713820.&amp;lt;/p&amp;gt;\\r\\n\\r\\n&amp;lt;p&amp;gt;Boutte, G. S. (2012). Urban schools: Challenges and possibilities for early childhood and elementary education. Urban Education, 47(2), 515-550. doi:10.1177/0042085911429583.&amp;lt;/p&amp;gt;\\r\\n\\r\\n&amp;lt;p&amp;gt;Budiman, N. (2016). Pendidikan profesional konselor multibudaya (Studi pengembangan pendidikan profesional konselor berbasis kompetensi multibudaya) (Doctoral dissertation, Sekolah Pascasarjana UPI).&amp;lt;/p&amp;gt;\\r\\n\\r\\n&amp;lt;p&amp;gt;Budiman, N. (2017, November). Competences of the 21st century: The development of multicultural counselor competences. Proceedings of the 1st International Conference on Educational Sciences, Bandung, West Java, Indonesia, 310-314.&amp;lt;/p&amp;gt;\\r\\n\\r\\n&amp;lt;p&amp;gt;Carlos, P. H. (2011). Developing counseling students&amp;amp;rsquo; multicultural competence through the multicultural action project. American Counseling Association Journal, 3(50), 402-420. doi:10.1002/j.1556-6978.2011.tb01924.x.&amp;lt;/p&amp;gt;\\r\\n\\r\\n&amp;lt;p&amp;gt;Cates, J. T., Schaefle, S. E., Smaby, M. H., Maddux, C. D., &amp;amp;amp; Beauf, I. L. (2007). Comparing multicultural with general counseling knowledge and skill competency for students who completed counselor training. Journal of Multicultural Counseling and Development: American Counseling Association, 35(1), 26-39. doi:10.1002/j.2161-1912.2007.tb00047.x.&amp;lt;/p&amp;gt;\\r\\n\\r\\n&amp;lt;p&amp;gt;Childs, K. (2017). Integrating multiculturalism in education for the 2020 classroom: Moving beyond the &amp;amp;ldquo;melting pot&amp;amp;rdquo; of festivals and recognition months. Journal for Multicultural Education, 11(1), 31-36. doi:10.1108/JME-06-2016-0041.&amp;lt;/p&amp;gt;\\r\\n\\r\\n&amp;lt;p&amp;gt;Chou, P. I, Sue, M. H. &amp;amp;amp; Wang, Y., T. (2018). Transforming teacher preparation for culturally responsive teachers in Taiwan. Teaching and Teacher Education, 75, 116-127. doi:10.1016/j.tate.2018.06.013.&amp;lt;/p&amp;gt;\\r\\n\\r\\n&amp;lt;p&amp;gt;Cicchelli, T. &amp;amp;amp; Cho, S. J. (2007). Teacher multicultural attitudes: intern/teaching fellows in New York city. Education and Urban Society, 39(3), 370-381. doi:10.1177/0013124506298061.&amp;lt;/p&amp;gt;\\r\\n\\r\\n&amp;lt;p&amp;gt;Cornish, J. A. E., Schreier, B. A., Nadkarni, L. I., Metzger, L. H., &amp;amp;amp; Rodolfa, E. R. (2010). Handbook of multicultural counseling competencies. Hoboken, NJ: John Wiley &amp;amp;amp; Sons.&amp;lt;/p&amp;gt;\\r\\n\\r\\n&amp;lt;p&amp;gt;Cross, T., Bazron, B., Dennis, K., &amp;amp;amp; Isaacs, M., (1989). Towards a culturally competent system of care, Volume I. Washington, DC: Georgetown University Child Development Center, CASSP Technical Assistance Center.&amp;lt;/p&amp;gt;\\r\\n\\r\\n&amp;lt;p&amp;gt;Delpit, L. (2003). Educators as &amp;amp;ldquo;seed people&amp;amp;rdquo; growing a new future. Educational Researcher, 32(7), 14-21. doi:10.3102/0013189X032007014.&amp;lt;/p&amp;gt;\\r\\n\\r\\n&amp;lt;p&amp;gt;Dolby, N. (2012). Rethinking multicultural education f