(128, '2019-10-08 11:29:19', 1, 'insert into awp_jurnal set jurnal=''THE ROLE OF SOCIAL CAPITAL IN DISASTER MANAGEMENT OF DISASTER VULNERABLE VILLAGE COMMUNITY ON THE MERAPI ERUPTION'', diskripsi=''Community resilience to anticipate disaster depends on the possession of social capital that grows in the community. Social capital can produce positive effects, unfortunately, disaster mitigations have been dominated by the development of human capital skills than social capital skills. This study aims to determine the role of social capital in disaster management in the disaster vulnerable communities of the Merapi Mount, taking a case in Girikerto village, Turi Sub-district, Sleman Regency, Special Province of Yogyakarta, Indonesia as one area with high risk of the eruption. Independent interviews and focused group discussions were done involving hamlet heads, village government officials, and members of community disaster organizations; in addition to observation in the village dailylife. The results showed that social capital covering values and norms, commitment, trust, networking and sharing of information or knowledge provides benefits in the form of increased community awareness of disaster, social solidarity, and disaster knowledge of the citizens. Therefore, it is important to held community empowerment using an educational approach that is based on the utilization of social capital directly and planned in disaster vulnerable areas for enlarging the resiliency capacity of community.'', abstrak=''&amp;lt;p&amp;gt;THE ROLE OF SOCIAL CAPITAL IN DISASTER MANAGEMENT OF DISASTER VULNERABLE VILLAGE COMMUNITY ON THE MERAPI ERUPTION&amp;lt;/p&amp;gt;\\r\\n\\r\\n&amp;lt;p&amp;gt;&amp;lt;img src=&amp;quot;https://journal.uny.ac.id/public/site/images/icons/icon-people.png&amp;quot; style=&amp;quot;height:16px&amp;quot; /&amp;gt;&amp;amp;nbsp;&amp;lt;em&amp;gt;Entoh Tohani, Lutfi Wibawa&amp;lt;/em&amp;gt;&amp;lt;/p&amp;gt;\\r\\n\\r\\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\\r\\n\\r\\n&amp;lt;p&amp;gt;&amp;lt;img src=&amp;quot;https://journal.uny.ac.id/public/site/images/icons/icon-doi.png&amp;quot; style=&amp;quot;height:16px&amp;quot; /&amp;gt;&amp;amp;nbsp;&amp;lt;a href=&amp;quot;http://dx.doi.org/10.21831/cp.v38i2.21821&amp;quot; style=&amp;quot;text-decoration-line: none; color: steelblue;&amp;quot;&amp;gt;10.21831/cp.v38i2.21821&amp;lt;/a&amp;gt;&amp;lt;/p&amp;gt;\\r\\n\\r\\n&amp;lt;p&amp;gt;Abstract&amp;lt;/p&amp;gt;\\r\\n\\r\\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\\r\\n\\r\\n&amp;lt;p&amp;gt;Community resilience to anticipate disaster depends on the possession of social capital that grows in the community. Social capital can produce positive effects, unfortunately, disaster mitigations have been dominated by the development of human capital skills than social capital skills. This study aims to determine the role of social capital in disaster management in the disaster vulnerable communities of the Merapi Mount, taking a case in Girikerto village, Turi Sub-district, Sleman Regency, Special Province of Yogyakarta, Indonesia as one area with high risk of the eruption. Independent interviews and focused group discussions were done involving hamlet heads, village government officials, and members of community disaster organizations; in addition to observation in the village dailylife. The results showed that social capital covering values and norms, commitment, trust, networking and sharing of information or knowledge provides benefits in the form of increased community awareness of disaster, social solidarity, and disaster knowledge of the citizens. Therefore, it is important to held community empowerment using an educational approach that is based on the utilization of social capital directly and planned in disaster vulnerable areas for enlarging the resiliency capacity of community.&amp;lt;/p&amp;gt;\\r\\n\\r\\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\\r\\n\\r\\n&amp;lt;p&amp;gt;Keywords&amp;lt;/p&amp;gt;\\r\\n\\r\\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\\r\\n\\r\\n&amp;lt;p&amp;gt;social capital; disaster; vulnerable; empowerment; management&amp;lt;/p&amp;gt;\\r\\n\\r\\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\\r\\n\\r\\n&amp;lt;p&amp;gt;References&amp;lt;/p&amp;gt;\\r\\n\\r\\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\\r\\n\\r\\n&amp;lt;p&amp;gt;Adler, P. S., &amp;amp;amp; Kwon, S. (2000). Social capital: The good, the bad, and the ugly. In E. Lesser (Ed.), Knowledge and social capital: Foundations and applications (pp. 89-115). Boston, MA: Butterworth-Heineman.&amp;lt;/p&amp;gt;\\r\\n\\r\\n&amp;lt;p&amp;gt;Aldrich, D. P., &amp;amp;amp; Meyer, M. A. (2015). Social capital and community resilience. American Behavioral Scientist, 59(2), 254&amp;amp;ndash;269. doi:10.1177%2F0002764214550299.&amp;lt;/p&amp;gt;\\r\\n\\r\\n&amp;lt;p&amp;gt;Ayriza, Y. (2011). Peningkatkan keterampilan guru bimbingan konseling dalam pemerolehan kesiapan psikologis siswa menghadapi bencana alam. Cakrawala Pendidikan, 30(2), 230-241. doi:10.21831/cp.v0i2.4230.&amp;lt;/p&amp;gt;\\r\\n\\r\\n&amp;lt;p&amp;gt;Bankoff, G. (2015). &amp;amp;quot;Lahat para sa lahat&amp;amp;quot; (everything to everybody): Consensual leadership, social capital and disaster risk reduction in a Filipino community. Disaster Prevention and Management, 24(4), 430-447. doi:10.1108/DPM-04-2014-0063.&amp;lt;/p&amp;gt;\\r\\n\\r\\n&amp;lt;p&amp;gt;Bhandari, R. B. (2014). Social capital in disaster risk management; a case study of social capital mobilization following the 1934 Kathmandu Valley earthquake in Nepal. Disaster Prevention and Management, 23(4), 314-328. doi:10.1108/DPM-06-2013-0105.&amp;lt;/p&amp;gt;\\r\\n\\r\\n&amp;lt;p&amp;gt;Bowen, G. A. (2009). Social capital, social funds and poor communities: An exploratory analysis. Social Politic Administration, 43(3), 245-269. doi:10.1111/j.1467-9515.2009.00660.x.&amp;lt;/p&amp;gt;\\r\\n\\r\\n&amp;lt;p&amp;gt;BPBD Yogyakarta. (2017). Peta