INSERT INTO `awp_video` (`video_id`, `section_id`, `video_title`, `video_description`, `youtube_id`, `thumbnail`, `publish`, `created_date`) VALUES
(27, 4, 'Gelar Kasus Terbuka, Tepatkah?', 'Proses hukum terhadap Gubernur DKI Jakarta Non Aktif, Basuki Tjahaja Purnama (Ahok) sudah mulai bergulir. Hari Senin (07/11/2016) ini Ahok diperiksa polisi terkait kasus dugaan penistaan agama. \r\n\r\nPublik terus mengikuti jalannya kasus ini, dan menanti hasil kerja penyelidikan aparat kepolisian. Unsur transparansi sudah ditekankan Presiden Jokowi dalam kasus ini, bahkan sempat bercetus untuk membuka secara umum gelar perkara kasusnya. Berikut tema dialog kita kali ini "Gelar Kasus Terbuka, Tepatkah?" di CNN Indonesia Prime News.\r\n\r\nIkuti berita dengan kemasan internasional berbahasa Indonesia di www.cnnindonesia.com dan channel CNN Indonesia di Transvision.', 'J8c82iOFIeg', '20171220110648.jpg', 0, '2015-11-09 04:48:22'),
(26, 5, 'Mbah Sadiman, Orang Sederhana, Berpikir Sederhana, Berkarya Besar', 'Mbah Sadiman, Orang Sederhana, Berpikir Sederhana, Berkarya Besar \r\n\r\nKoresponden: Miladia Rahma\r\n\r\nIkuti berita dengan kemasan internasional berbahasa Indonesia di www.cnnindonesia.com dan channel CNN Indonesia di Trans Vision.', 'dMen-u7Jnu8', '20171220110701.jpg', 0, '2015-11-09 04:46:28'),
(29, 4, 'Siapa Pemilik Jaket Bomber Jokowi yang Kini Ngetren?', 'Disela-sela pidato kunjungan ke di Gedung Pusat Dakwah Muhammadiyah, Selasa (8/11), Presiden Joko Widodo ditanya soal jaket yang dikenakannya saat pidato kenegaraan lalu di Istana. Lalu apa jawaban orang nomor 1 RI ini?\r\n\r\nIkuti berita dengan kemasan internasional berbahasa Indonesia di www.cnnindonesia.com dan channel CNN Indonesia di Transvision.', 'UxtQROwnBNA', '', 0, '2015-11-11 08:45:05'),
(31, 4, 'Istri Cawagub Djarot, Happy Farida Kunjungi Kampung Tridharma, Pondok Labu', 'Tak hanya para calon, peran para istri calon gubernur dan wakil gubernur DKI Jakarta dalam Pilkada juga tidak boleh disepelekan. Sebab, para isteri juga bisa  menjadi kepanjangan tangan dari para calon dalam menyampaikan visi dan misi.\r\n\r\nIkuti berita dengan kemasan internasional berbahasa Indonesia di www.cnnindonesia.com dan channel CNN Indonesia di Transvision.', 'MKYzUwQ3RwA', '', 0, '2016-11-04 04:02:38'),
(32, 4, 'FULL- Ahok Lapar & Irit Bicara usai 9 Jam Diperiksa Bareskrim', 'Gubernur DKI Jakarta nonaktif Basuki Tjahaja Purnama (Ahok) diperiksa selama 9 jam oleh penyidik Bareskrim Polri terkait pidato kontroversi surat Al Maidah 51. Ahok ditanya 22 pertanyaan.\r\n\r\nAhok tiba di Mabes Polri sekitar pukul 08.12 WIB, sedangkan Ahok keluar ruangan sekitar pukul 17.00 WIB. \r\n\r\nIkuti berita dengan kemasan internasional berbahasa Indonesia di www.cnnindonesia.com dan channel CNN Indonesia di Transvision.', 'Ig067zIGAyU', '', 0, '2016-11-04 04:04:38'),
(33, 6, 'Kembali Terkuak, 7 Sosok Mahaguru Dimas Kanjeng', 'Kepolisian daerah Jawa Timur, Senin (07/11/2016) siang, merilis tujuh mahaguru, atau yang biasa disebut abah oleh Dimas Kanjeng. Mahaguru tersebut sengaja direkrut untuk mengelabui para pengikut Dimas Kanjeng, agar tertarik bergabung dan menyetorkan uang kepada Taat Pribadi. Namun, mereka yang selama ini diagung-agungkan, ternyata memiliki latar belakang yang memprihatinkan.\r\n\r\nIkuti berita dengan kemasan internasional berbahasa Indonesia di www.cnnindonesia.com dan channel CNN Indonesia di Transvision.', 'sCbd8O79gXk', '20171220110614.jpg', 0, '2016-11-04 04:05:52'),
(34, 5, 'Ahmad Dhani Bantah Menghina Presiden Jokowi', 'Ahmad Dhani membantah dirinya telah menghina Presiden Jokowi dalam orasinya saat demo 4 November lalu. Dhani mengatakan dalam orasinya tidak bermaksud menghina Presiden Jokowi, seperti yang beredar di media sosial pasca demo 4 November lalu.\r\n\r\n\r\nIkuti berita dengan kemasan internasional berbahasa Indonesia di www.cnnindonesia.com dan channel CNN Indonesia di Transvision.', 'OXj7wFDFW7g', '20171220110608.jpg', 0, '2016-11-04 04:06:20'),
(35, 4, 'Pin Sudiraharti - Memecah Sunyi, Meraih Mimpi', 'Pin Sudiraharti gelisah dengan label anak tunarungu sebagai anak yang bisu dan tuli. Melalui  pengalamannya sebagai guru di Sebuah SLB, ia kemudian mendirikan SLB Prima Bakti Mulia di daerah Cimahi, Bandung.\r\n\r\nSekolah ini ia dirikan dari menyisihkan penghasilannya sebagai perias pengantin. Metode pengajaran yang dipakai adalah terapi bicara atau metode oral.\r\n\r\nPin sudiraharti tidak mengesampingkan anggapan, bahwa metode ini akan memaksa anak tunarungu berbicara, namun menurutnya, metode ini merupakan cara yang paling efektif agar anak tunarungu bisa segera bersosialisasi dengan masyarakat yang lain.\r\n\r\nIkuti berita dengan kemasan internasional berbahasa Indonesia di www.cnnindonesia.com dan channel CNN Indonesia di Trans Vision.', 'NBp5tvUz3lo', '20171220110507.jpg', 0, '2016-11-08 04:34:00'),
(36, 6, 'Padi - Sang Penghibur (Original Clip) [1080p HD]', 'From Album: Tak Hanya Diam\r\nArtis: Padi\r\nSong Title: Sang Penghibur \r\nSutradara: Eugene Panji\r\nLokasi: London , Inggris\r\nWaktu: Oktober 2008\r\nSinopsis: Menceritakan seorang seniman dari desa pergi kekota untuk menghibur disebuah kota besar dan ternyata apa yg dia bayangkan tidak seperti yg di bayangkan.', '6xlO5PtKNPA', '20171221020018.jpg', 0, '2017-12-21 01:22:04'),
(37, 4, 'Ada Apa dengan Sungai Citarum?', 'Sungai Citarum. Sungai yang sedang ramai menjadi bahan perbincangan dan pergunjingan masyarakat Nasional dan beberapa pihak Internasional memiliki tingkat pencemaran yang sangat luar biasa parahnya, bahkan dinobatkan sebagai salah satu sungai paling tercemar di dunia! \r\n\r\nTapi kebanyakan dari kita cuma bisa mengeluh dan protes sama keadaan Citarum, tanpa sadar kalau sebenernya kewajiban kita juga tuh menjaga dan memperbaiki keadaan yang mengerikan ini. Bukan tidak mugkin, Sungai Citarum bisa berubah jadi bersih dan sehat kembali. Tapi hal ini gak instan, ada beberapa hal yang wajib kamu tahu tentang Citarum. Udah siap menjadikan citarum sebagai sungai terciamik di dunia?', 'X4_v10Jcqbo', '20180514034430.jpg', 1, '2018-05-14 03:44:30');

